	add("baboon", "{\"term\":\"baboon\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"German\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Proto-Germanic\", \"middle high german (ca. 1050-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027babewin\u0027 \u0027baboin\u0027 from Old french (842-ca. 1400) \u0027babouin\u0027 from \u0027baboue\u0027 (grimace, muzzle) of Proto-germanic origin, related to German dialectal \u0027bäppe\u0027 (muzzle) Middle high german (ca. 1050-1500) \u0027beffen\u0027 (to bark) Middle english (1100-1500) \u0027baffen\u0027 (to bark) See also {{l/en|baff}}, {{l/en|baffle}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Old World monkey of the genus \u0027Papio\u0027, having dog-like muzzles and large canine teeth, cheek pouches, a short tail, and naked callosities on the buttocks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027: Philip José Farmer, \u0027Down in the Black Gang: and others; a story collection\u0027, [http://books.google.co.uk/books?id\u003dqPkdAAAAMAAJ\u0026amp;q\u003d%22congress+of+baboons%22\u0026amp;dq\u003d%22congress+of+baboons%22\u0026amp;ei\u003dROw_SvKML6DcMIev3MAO\u0026amp;pgis\u003d1 page 79] (Nelson Doubleday\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Mix swallowed the comment he wanted to make, that the council hall stank like a congress of \u0027\u0027baboons\u0027\u0027. But he was in no position to insult his host, nor should he. The man was only expressing the attitude of his time\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dHe draws eclectically on studies of \u0027\u0027baboons\u0027\u0027, descriptive anthropological accounts of hunter-gatherer societies and, in a few cases, the fossil record\", \"priority\":4}]}, \"synonyms\":{}}");

